import { FormLabel, TextField } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const AddBook = () =>{
    return(
        <form>
            <Box display="flex" 
                flexDirection="column" 
                justifyContent={'center'} 
                maxWidth={700} 
                alignContent={"center"}
                alignSelf="center"
                marginLeft={"auto"}
                marginRight="auto"
                marginTop={10}
                >
                <FormLabel>Book Name</FormLabel>
                <TextField margin="normal" placeholder="Harry Poter" fullWidth variant="outlined" name="name"/>
                <FormLabel>Book Description / Author</FormLabel>
                <TextField margin="normal" placeholder="Written By Charles Hawak" fullWidth variant="outlined" name="name"/>
                <FormLabel>Book Price/ Unit in Rs.</FormLabel>
                <TextField type="number" margin="normal" placeholder="500" fullWidth variant="outlined" name="name"/>
                <FormLabel>Book Img Url</FormLabel>
                <TextField margin="normal" placeholder="https://upload.wikimedia.org/wikipedia/en/8/85/Terminator2poster.jpg" fullWidth variant="outlined" name="name"/>
            </Box>
        </form>
    )
}

export default AddBook;
